import { useNavigate } from 'react-router-dom';
import { handleSuccess } from '../../utils/utils';
import { ToastContainer } from 'react-toastify';
import './Home.css';

function CompanyHome() {
    const navigate = useNavigate();

    const handleLogout = (e) => {
        localStorage.removeItem('token');
        localStorage.removeItem('loggedInUser');
        localStorage.removeItem('role');
        handleSuccess('User Loggedout');
        setTimeout(() => {
            navigate('/supplier-login');
        }, 1000)
    }

    return(
        <section>
            <button onClick={handleLogout}>Logout</button>
            <div class="container cont-card">
                <div class="row">
                    <div class="col-xxl-3 col-xl-3 col-lg-6 col-md-6 col-sm-12 col-xs-12 cards">
                        <div class="card">
                            <a href="">
                                <div class="card-body">
                                    <img src="./assets/img/img-card/h.png" alt="card-1" class="card-img" />
                                    <p class="desc-card">Helping</p>
                                </div>
                            </a>
                        </div>
                    </div>
                    <div class="col-xxl-3 col-xl-3 col-lg-6 col-md-6 col-sm-12 col-xs-12">
                        <div class="card">
                            <a href="">
                                <div class="card-body">
                                    <img src="./assets/img/img-card/o.png" alt="card-2" class="card-img" />
                                    <p class="desc-card">Orphans</p>
                                </div>
                            </a>
                        </div>
                    </div>
                </div>
            </div>
            <ToastContainer />
        </section>
    );
}
export default CompanyHome;
